// src/components/Home.js
import React from 'react';
import './Home.css';

function Home() {
  return (
    <section id="home" className="Home">
      <h1>Welcome to My Portfolio</h1>
      <p>Hi, I'm Memory. I'm a web developer.</p>
    </section>
  );
}

export default Home;
